return (int)Token.CASE;
            break;
        case 124: // Recognized '"break"',	Shortest string "break"
return (int)Token.BREAK;
            break;
        case 125: // Recognized '">="',	Shortest string ">="
return (int)Token.LEGT;
            break;
        case 126: // Recognized '">>"',	Shortest string ">>"
return (int)Token.BITWISERIGHT;
            break;
        case 127: // Recognized '"=="',	Shortest string "=="
return (int)Token.EQUALS;
            break;
        case 128: // Recognized '"<<"',	Shortest string "<<"
return (int)Token.BITWISELEFT;
            break;
        case 129: // Recognized '"<="',	Shortest string "<="
return (int)Token.REGT;
            break;
        case 130: // Recognized '{Float}',	Shortest string ".0"
yylval.d = Double.Parse(yytext); return (int)Token.VALFLOAT;
            break;
        case 131: // Recognized '{SingleComment}',	Shortest string "//\x01"
;
            break;
        case 132: // Recognized '{MultiComment}',	Shortest string "/**/"
;
            break;
        case 133: // Recognized '"&&"',	Shortest string "&&"
return (int)Token.BOOLAND;
            break;
        case 134: // Recognized '"!="',	Shortest string "!="
return (int)Token.NOTEQUALS;
            break;
        default:
            break;
    }
#pragma warning restore 162, 1522
#endregion
                    }
                }
        }

#if BACKUP
        void SaveStateAndPos(ref Context ctx) {
            ctx.bPos  = buffer.Pos;
            ctx.rPos  = readPos;
            ctx.cCol  = cCol;
            ctx.lNum  = lNum;
            ctx.state = state;
            ctx.cChr  = code;
        }

        void RestoreStateAndPos(ref Context ctx) {
            buffer.Pos = ctx.bPos;
            readPos = ctx.rPos;
            cCol  = ctx.cCol;
            lNum  = ctx.lNum;
            state = ctx.state;
            code  = ctx.cChr;
        }
#endif  // BACKUP

        // ============= End of the tokenizer code ================

#if STACK        
        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        internal void yy_clear_stack() { scStack.Clear(); }
        
        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        internal int yy_top_state() { return scStack.Peek(); }
        
        internal void yy_push_state(int state)
        {
            scStack.Push(currentScOrd);
            BEGIN(state);
        }
        
        internal void yy_pop_state()
        {
            // Protect against input errors that pop too far ...
            if (scStack.Count > 0) {
				int newSc = scStack.Pop();
				BEGIN(newSc);
            } // Otherwise leave stack unchanged.
        }
 #endif // STACK

        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        internal void ECHO() { Console.Out.Write(yytext); }
        
    } // end class $Scanner


